script: |
  super -f text -I q10095.spq | sort > q10095.out

inputs:
  - name: q10095.spq
    data: |
      SELECT DISTINCT COUNT ( * ) + - - 44 FROM tab1 (FORMAT parquet) WHERE 0 + + col1 NOT BETWEEN 81 + + 32 * + col2 * - 19 AND + - col0;
  - name: tab1

outputs:
  - name: q10095.out
    data: |
      47
